<template>
    <button
        class="vue3rdj5__modes-open"
        :class="[ selectedMode === name ? 'vue3rdj5__modes-open-active' : '' ]"
        @click="selectMode()"
        type="button">
        <img
            class="vue3rdj5__modes-logo"
            :class="[ 'vue3rdj5__modes-logo-' + nameToClass ]"
            :src="logos[name]"
            :alt="name + ' Logo'">
        {{ name }}
    </button>
</template>

<script>
export default {
    data () {
        return {
            logos: {
                'Defi Wallet': 'data:image/png;base64,',
                'Ledger': 'data:image/png;base64,',
                'Maiar': 'data:image/png;base64,',
                'Web Wallet': 'data:image/png;base64,'
            },
        }
    },
    props: {
        name: {
            type: String,
            default: ''
        },
        logo: {
            type: String,
            default: ''
        },
        selectedMode: {
            type: String,
            default: ''
        }
    },
    computed: {
        nameToClass () {
            return this.name.toLowerCase().replaceAll(' ','-');
        }
    },
    methods: {
        selectMode () {
            if ( this.selectedMode === this.name ) {
                this.$emit('select-mode', '');
            } else {
                this.$emit('select-mode', this.name);
            }
        }
    }
}
</script>
